import React from "react";
import "./App.css";
import { Home, Navbar, Header } from "./components";
import { BrowserRouter as Router, Route, Link, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <div className="app">
          {/* <Navbar /> */}
          <Route exact path="/" element={<Home />} />
          <Route
            exact
            path="checkout"
            element={<Route element={<Header />} />}
          />
        </div>
      </Routes>
    </Router>
  );
}

export default App;
